            "lineNumber": thisLineNumber,
            "detail": "lines must be indented to a strict boundary of " + expected_tab_spaces + " spaces",
            "context": line,
            "fixInfo": {
              "lineNumber": thisLineNumber,
              "deleteCount": got_tab_spaces,
              "insertText": suggested_spacing, // insert at beginning of lineNumber
            },
